import './Navbar.css';
import React, { Component, useState, useEffect } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import MenuItem from '@material-ui/core/MenuItem';
import Menu from '@material-ui/core/Menu';
import { Link } from 'react-router-dom';


const useStyles = makeStyles((theme) => ({
  //  appbarTitle: {
  //      flexGrow: 1,
  //      display: 'flex',
  //      fontFamily: "AudioWide",
  //      color: "#fff",
  //      fontSize: "2rem"
  //    },

  //  appbar: {
  //    background: "none",
  //    padding: theme.spacing(1, 1, 5, 0),
  //   },

  //   menuButton: {
  //    marginRight: theme.spacing(2),
  //    color: "#fff",
  //    fontSize: "2rem"
  //  },

}));

export default function Navbar() {
 const classes = useStyles();

  const [click, setClick] = useState(false);

  const handleClick = () => setClick(!click);
  const closeMobileMenu = () => setClick(false);

  return (
    <div >
    <div >
   <AppBar className="navbar">
     <Toolbar className='navbar-container'>
       <Typography  variant="body2" >
       <Link to="/" className='navbar-logo' onClick={closeMobileMenu}>Skywalker</Link>
       </Typography>



    <div className='menu-icon' onClick={handleClick}>
           <i className={click ? 'fas fa-times' : 'fas fa-bars'} />
         </div>

           <Menu className={click ? 'nav-menu active' : 'nav-menu'}>

            <MenuItem className="nav-item">

            <Link className='nav-links' onClick={closeMobileMenu} to="/">Home</Link>

             </MenuItem>

             <MenuItem className="nav-item">
             <Link className='nav-links' onClick={closeMobileMenu} to="/resume">Resume</Link>
             </MenuItem>

             <MenuItem className='nav-item'>
             <Link className='nav-links' onClick={closeMobileMenu} to="/projects">Projects</Link>
             </MenuItem>

             <MenuItem className='nav-item'>
             <Link className='nav-links' onClick={closeMobileMenu} to="/contact">Contact</Link>
             </MenuItem>

           </Menu>
     </Toolbar>
   </AppBar>
   </div>
 </div>
);
}
